import VideoPlayer from "../components/VideoPlayer";
import DescriptionPane from "../components/DescriptionPane";
import TaskDescription from "../components/TaskDescription";

export default function Task1Page(props) {
    const taskDescription =
        "How do you characterize the activity in the video? Please specify propositions that distinguish this activity from any other activity";

    return (
        <div id="main-container">
            <div id="player-container">
                <TaskDescription id="task-description-1" description={taskDescription} />
                <VideoPlayer
                    id="video-player"
                    width="600px"
                    height="350px"
                    onVideoPlay={this.handleVideoPlay}
                />
            </div>
            <DescriptionPane
                id="description-pane"
                videoID={this.state.videoId}
                user={this.user}
            />
        </div>
    );
}
